import FirstPage from "../SVG/FirstPage";
import LastPage from "../SVG/LastPage";
import PushLeft from "../SVG/PushLeft";
import PushRight from "../SVG/PushRight";

export const TableButtons = (gotoPage, canPreviousPage, canNextPage, previousPage, nextPage, pageCount,handlePageChange) =>{
    return <div><button onClick={()=> {gotoPage(0); }} disabled={!canPreviousPage}><FirstPage/></button>
    <button onClick={()=> {previousPage(); handlePageChange();}} disabled={!canPreviousPage}><PushLeft/></button>
    <button onClick={()=> {nextPage(); handlePageChange();}} disabled={!canNextPage}><PushRight/></button>
    <button onClick={()=> {gotoPage(pageCount-1); handlePageChange();}} disabled={!canNextPage}><LastPage/></button>
    </div>
}
